// Embedded web fonts (base64) used by the plugin.
// To add a font, paste the base64-encoded WOFF2 strings below.
// Keeping this in a separate file avoids bloating the main stylesheet.

export interface EmbeddedFontVariants {
  normal?: string;     // base64 for woff2, weight 400, font-style: normal
  bold?: string;       // base64 for woff2, weight 700, font-style: normal
  italic?: string;     // base64 for woff2, weight 400, font-style: italic (optional)
  boldItalic?: string; // base64 for woff2, weight 700, font-style: italic (optional)
}

export const EMBEDDED_FONTS: Record<string, EmbeddedFontVariants> = {
  // Example structure; leave strings empty to disable embedding and rely on fallbacks.
  // Replace "..." with actual base64 (no data: prefix, just the raw base64 payload).
  Asimovian: {
    normal: '',
    bold: ''
  }
};
